{'push_id': 9625462251, 'size': 2, 'distinct_size': 2, 'ref': 'refs/heads/ivoanjo/send-cancellation', 'head': '4e7ce4502bb7f5146f36083ff2d9f994d43dd613', 'before': 'ef10657eada1663c0795449d68fb56d15715cd73', 'commits': [{'sha': 'abbf76c0ea20b55793481e481663d9236504c885', 'author': {'email': 'ivo.anjo@datadoghq.com', 'name': 'Ivo Anjo'}, 'message': 'Make `CancellationToken` optional when calling `Request::send`', 'distinct': True, 'url': 'https://api.github.com/repos/DataDog/libddprof/commits/abbf76c0ea20b55793481e481663d9236504c885'}, {'sha': '4e7ce4502bb7f5146f36083ff2d9f994d43dd613', 'author': {'email': 'ivo.anjo@datadoghq.com', 'name': 'Ivo Anjo'}, 'message': "Introduce `ddprof_ffi_CancellationToken_clone` and update example to use it

A cloned CancellationToken is connected to the CancellationToken it was
created from.
Either the cloned or the original token can be used to cancel or
provided as arguments to send.
The useful part is that they have independent lifetimes and can be
dropped separately.

Thus, it's possible to do something like:

```c
cancel_t1 = ddprof_ffi_CancellationToken_new();
cancel_t2 = ddprof_ffi_CancellationToken_clone(cancel_t1);

// On thread t1:
    ddprof_ffi_ProfileExporterV3_send(..., cancel_t1);
    ddprof_ffi_CancellationToken_drop(cancel_t1);

// On thread t2:
    ddprof_ffi_CancellationToken_cancel(cancel_t2);
    ddprof_ffi_CancellationToken_drop(cancel_t2);
```

Without clone, both t1 and t2 would need to synchronize to make sure
neither was using the cancel before it could be dropped. With clone,
there is no need for such synchronization, both threads have their
own cancel and should drop that cancel after they are done with it.", 'distinct': True, 'url': 'https://api.github.com/repos/DataDog/libddprof/commits/4e7ce4502bb7f5146f36083ff2d9f994d43dd613'}]}

