ts{/gist_id}', 'starred_url': 'https://api.github.com/users/morrisonlevi/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/morrisonlevi/subscriptions', 'organizations_url': 'https://api.github.com/users/morrisonlevi/orgs', 'repos_url': 'https://api.github.com/users/morrisonlevi/repos', 'events_url': 'https://api.github.com/users/morrisonlevi/events{/privacy}', 'received_events_url': 'https://api.github.com/users/morrisonlevi/received_events', 'type': 'User', 'site_admin': False}, 'body': '# What does this PR do?

This adds back the tags FFI API and supports `DD_TAGS` parsing.

Fixes the exporter example.

# Motivation

I want DD_TAGS parsing in PHP and it wasn't as simple as I hoped, so
trying to share the work here too.

# Additional Notes

The `test_dup` test is the one that would previously sigsgev (sometimes).
Now that lifetimes and other things have been cleaned up, I can't get
it to sigsev anymore.

# How to test the change?

Most `ddprof_ffi_Vec_tag` functions are the same as before. The new
function `ddprof_ffi_Vec_tag_parse` takes a `CharSlice` and returns a
`ParseTagsResult`:

```rust
#[repr(C)]
pub struct ParseTagsResult {
    tags: crate::Vec<Tag>,
    error_message: Option<Box<crate::Vec<u8>>>,
}
```

