ttps://api.github.com/users/morrisonlevi/subscriptions', 'organizations_url': 'https://api.github.com/users/morrisonlevi/orgs', 'repos_url': 'https://api.github.com/users/morrisonlevi/repos', 'events_url': 'https://api.github.com/users/morrisonlevi/events{/privacy}', 'received_events_url': 'https://api.github.com/users/morrisonlevi/received_events', 'type': 'User', 'site_admin': False}, 'body': "This started with enhancing tags, but when I was done I discovered a
