art_line': 317, 'original_start_line': 317, 'start_side': 'RIGHT', 'line': 322, 'original_line': 322, 'side': 'RIGHT', 'in_reply_to_id': 838266857}, 'pull_request': {'url': 'https://api.github.com/repos/DataDog/libddprof/pulls/41', 'id': 893557774, 'node_id': 'PR_kwDOGEBa8s41QpwO', 'html_url': 'https://github.com/DataDog/libddprof/pull/41', 'diff_url': 'https://github.com/DataDog/libddprof/pull/41.diff', 'patch_url': 'https://github.com/DataDog/libddprof/pull/41.patch', 'issue_url': 'https://api.github.com/repos/DataDog/libddprof/issues/41', 'number': 41, 'state': 'open', 'locked': False, 'title': 'Add Vec type, remove Buffer, add SendResult_drop', 'user': {'login': 'morrisonlevi', 'id': 253316, 'node_id': 'MDQ6VXNlcjI1MzMxNg==', 'avatar_url': 'https://avatars.githubusercontent.com/u/253316?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/morrisonlevi', 'html_url': 'https://github.com/morrisonlevi', 'followers_url': 'https://api.github.com/users/morrisonlevi/followers', 'following_url': 'https://api.github.com/users/morrisonlevi/following{/other_user}', 'gists_url': 'https://api.github.com/users/morrisonlevi/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/morrisonlevi/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/morrisonlevi/subscriptions', 'organizations_url': 'https://api.github.com/users/morrisonlevi/orgs', 'repos_url': 'https://api.github.com/users/morrisonlevi/repos', 'events_url': 'https://api.github.com/users/morrisonlevi/events{/privacy}', 'received_events_url': 'https://api.github.com/users/morrisonlevi/received_events', 'type': 'User', 'site_admin': False}, 'body': "# What does this PR do?

Adds:

- A new `repr(C)` `Vec` type.
- FFI functions to deal with `Vec<Tag>`, including a helper for parsing
`DD_TAGS`.
- `ddprof_ffi_SendResult_drop` destructor.

Removes:

- Buffer. Use `Vec<u8>` instead.
- `ddprof_ffi_Buffer_reset`. Probably you should use
`ddprof_ffi_SendResult_drop` instead, as resetting the buffer was only
really used in the failure case of a SendResult.
- `ddprof_ffi_Buffer_free`. There aren't any APIs left which create a
`Box<Vec<u8>>` to use it on.

# Motivation

I wanted an API in PHP for dynamic tag management, and Ivo said he'd
like it for Ruby as well. 

# Additional Notes

I started off using opaque types, but cbindgen was failing to generate
correct C code for `Box<Vec<Tag>>` when used in an enum. So, instead I
made the FFI vec type. This technically saves an allocation as well.

# How to test the change?

Make the above changes, then use as normal. The functions below may be
helpful creating a dynamic array of tags:

```c
ddprof_ffi_Vec_tag ddprof_ffi_Vec_tag_new(void);
void ddprof_ffi_Vec_tag_push(ddprof_ffi_Vec_tag *vec, ddprof_ffi_Tag tag);
ddprof_ffi_Slice_tag ddprof_ffi_Vec_tag_as_slice(const ddprof_ffi_Vec_tag *vec);
void ddprof_ffi_Vec_tag_drop(ddprof_ffi_Vec_tag vec);
