void ddprof_ffi_Vec_tag_push(ddprof_ffi_Vec_tag *vec, ddprof_ffi_Tag tag);
ddprof_ffi_Slice_tag ddprof_ffi_Vec_tag_as_slice(const ddprof_ffi_Vec_tag *vec);
void ddprof_ffi_Vec_tag_drop(ddprof_ffi_Vec_tag vec);
void ddprof_ffi_VecTagResult_drop(ddprof_ffi_VecTagResult result);
ddprof_ffi_VecTagResult ddprof_ffi_Vec_tag_parse(ddprof_ffi_CharSlice string);
ddprof_ffi_VecTagResult ddprof_ffi_Vec_tag_clone(const ddprof_ffi_Vec_tag *vec);
void ddprof_ffi_VecTagResult_drop(ddprof_ffi_VecTagResult result);
```", 'created_at': '2022-03-29T21:44:02Z', 'updated_at': '2022-03-30T08:55:01Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': '88e92e96e3f882cb65711957e05399c9215c651e', 'assignee': None, 'assignees': [], 'requested_reviewers': [], 'requested_teams': [], 'labels': [], 'milestone': None, 'draft': False, 'commits_url': 'https://api.github.com/repos/DataDog/libddprof/pulls/41/commits', 'review_comments_url': 'https://api.github.com/repos/DataDog/libddprof/pulls/41/comments', 'review_comment_url': 'https://api.github.com/repos/DataDog/libddprof/pulls/comments{/number}', 'comments_url': 'https://api.github.com/repos/DataDog/libddprof/issues/41/comments', 'statuses_url': 'https://api.github.com/repos/DataDog/libddprof/statuses/c8962e97c451ce083d424dd97c33ada195b1b44a', 'head': {'label': 'DataDog:levi/vec', 'ref': 'levi/vec', 'sha': 'c8962e97c451ce083d424dd97c33ada195b1b44a', 'user': {'login': 'DataDog', 'id': 365230, 'node_id': 'MDEyOk9yZ2FuaXphdGlvbjM2NTIzMA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/365230?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/DataDog', 'html_url': 'https://github.com/DataDog', 'followers_url': 'https://api.github.com/users/DataDog/followers', 'following_url': 'https://api.github.com/users/DataDog/following{/other_user}', 'gists_url': 'https://api.github.com/users/DataDog/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/DataDog/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/DataDog/subscriptions', 'organizations_url': 'https://api.github.com/users/DataDog/orgs', 'repos_url': 'https://api.github.com/users/DataDog/repos', 'events_url': 'https://api.github.com/users/DataDog/events{/privacy}', 'received_events_url': 'https://api.github.com/users/DataDog/received_events', 'type': 'Organization', 'site_admin': False}, 'repo': {'id': 406870770, 'node_id': 'MDEwOlJlcG9zaXRvcnk0MDY4NzA3NzA=', 'name': 'libddprof', 'full_name': 'DataDog/libddprof', 'private': False, 'o