+extern crate alloc;
+
+use crate::Slice;
+use std::io::Write;
+use std::marker::PhantomData;
+use std::mem::ManuallyDrop;
+
+/// Holds the raw parts of a Rust Vec; it should only be created from Rust,
+/// never from C.
+/// The names ptr and len were chosen to minimize conversion from a previous
+/// Buffer type which this has replaced to become more general.
+#[repr(C)]
+pub struct Vec<T: Sized> {
+    ptr: *const T,
+    len: usize,
+    capacity: usize,
+    _marker: PhantomData<T>,
+}
+
+impl<T> Drop for Vec<T> {
+    fn drop(&mut self) {
+        let vec =
+            unsafe { alloc::vec::Vec::from_raw_parts(self.ptr as *mut T, self.len, self.capacity) };
+        std::mem::drop(vec)
+    }
+}', 'path': 'ddprof-ffi/src/vec.rs', 'position': 26, 'original_position': 26, 'commit_id': 'c8962e97c451ce083d424dd97c33ada195b1b44a', 'original_commit_id': 'c8962e97c451ce083d424dd97c33ada195b1b44a', 'user': {'login': 'ivoanjo', 'id': 2785847, 'node_id': 'MDQ6VXNlcjI3ODU4NDc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/2785847?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ivoanjo', 'html_url': 'https://github.com/ivoanjo', 'followers_url': 'https://api.github.com/users/ivoanjo/followers', 'following_url': 'https://api.github.com/users/ivoanjo/following{/other_user}', 'gists_url': 'https://api.github.com/users/ivoanjo/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ivoanjo/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ivoanjo/subscriptions', 'organizations_url': 'https://api.github.com/users/ivoanjo/orgs', 'repos_url': 'https://api.github.com/users/ivoanjo/repos', 'events_url': 'https://api.github.com/users/ivoanjo/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ivoanjo/received_events', 'type': 'User', 'site_admin': False}, 'body': 'Minor: My rust-foo as usually a bit meh, but since we have a `impl<T> From<Vec<T>> for alloc::vec::Vec<T>` could we use that here to avoid repeating the `unsafe { ... }` part?', 'created_at': '2022-03-30T08:51:04Z', 'updated_at': '2022-03-30T08:55:01Z', 'html_url': 'https://github.com/DataDog/libddprof/pull/41#discussion_r838289321', 'pull_request_url': 'https://api.github.com/repos/DataDog/libddprof/pulls/41', 'author_association': 'MEMBER', '_links': {'self': {'href': 'https://api.github.com/repos/DataDog/libddprof/pulls/comments/838289321'}, 'html': {'href': 'https://github.com/DataDog/libddprof/pull/41#discussion_r838289321'}, 'pull_request': {'href': 'https://api.github.com/repos/DataDog/libddprof/pulls/41'}}, 'reactions': {'url': 'https://api.github.com/repos/DataDog/libddprof/pulls/comments/838289321/reactions', 'total_count': 0, '+